import React from 'react';


import './css/main.css';

import {MenuContainer,
        MenuBrick,
        Header,
        MainPane,
        HeaderPane} from './Components.js'
import {Home} from './Home.js'
import {About} from './About.js'
import {Opinions} from './Opinions.js'
import {Prices} from './Prices.js'

var menuList = [{name: "Aktualności", id: "home", class: Home},
                {name: "O Mnie", id: "about", class: Prices},
                {name: "Cennik", id: "prices", class: Prices},
                {name: "Opinie", id:"opinions", class: Opinions}];

function App() {
  return (
    <HashRouter>
      <div className="app">
        <Header>Jarosław Kalinowski</Header>
        <MenuContainer menuList={menuList} />
        <MainPane menuList={menuList} />
      </div>
    </HashRouter>
  );
}

export default App;
